import './App.css';
import PendingTracking from './components/PendingTracking';
import Scanned from './components/Scanned';
import TrackingInput from './components/TrackingInput';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <div className="App" >
      <Grid container spacing={5} >
        <Grid item xs={4}>
          <PendingTracking />
        </Grid>
        <Grid item xs={4}>
          <TrackingInput />
        </Grid>
        <Grid item xs={4}>
          <Scanned />
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
